          },
          "text": {
            "size": "size2",
            "align": "left",
            "color": "color1",
            "content": [
              "\"Удлинитель с заземлением, произведенный в Турции, с длиной 3 метра и 6 гнездами (розетками), представляет собой надежное и безопасное решение для подключения различных электроприборов. Этот удлинитель оснащен качественным проводом ПВС с медной токопроводящей жилой, двойной ПВХ изоляцией и характеризуется устойчивостью к нагреву, а также повышенной гибкостью, обеспечивая надежную работу на долгий срок.",
              "",
              "Гнездовые контакты удлинителя расположены под углом, что облегчает одновременное подключение нескольких приборов. Они подходят для штепсельных вилок как российского, так и европейского стандарта, обеспечивая универсальность использования. Корпус удлинителя изготовлен из термоустойчивого и ударопрочного пластика, что делает его прочным и долговечным.",
              "",
              "Контактная группа удлинителя изготовлена из латуни, обеспечивая высокую электропроводность и максимально плотный контакт со штырями вилок подключаемых приборов. Вся продукция соответствует нормам российского ГОСТ и EAC, гарантируя высокий стандарт безопасности и качества. Все удлинители проходят двойной контроль качества и работоспособности, что подчеркивает надежность данного продукта.",
              "",
              "Сечение провода удлинителя с заземлением составляет 3 х 1,0 мм2, что обеспечивает надежную передачу электроэнергии и соблюдение стандартов безопасности. Покупка этого удлинителя - это уверенность в надежности и долговечности вашего электрооборудования.",
              ""
            ]
          },
          "reverse": false
        }
      ]
